function DateComp(prop) {
  var day = prop.getDay();
  var month = prop.getMonth();
  var year = prop.getFullYear();
  return (
    <div>
      <div>{day}</div>
      <div>{month}</div>
      <div>{year}</div>
    </div>
  );
}

export default DateComp;
